import React from 'react'
import DarkMood from '../../../assets/icons/DarkMood';
import LightMood from 'src/assets/icons/LightMood';

export default function MoodSwitcher({isDarkMode, toggleTheme}) {

  return (
    <>
        {isDarkMode ? <DarkMood onClick={toggleTheme} className='p-5' /> : <LightMood onClick={toggleTheme} className='p-5' />}
    </>
  )
}
